import React from "react";
function Main({currData}){

    const prize =(curr)=>{
        const prizeb =document.querySelector(".prizebtn");
        prizeb.innerHTML = curr.prize;
    }
    return (
    <>
        <div className="main">
        {currData.map((currElem)=>{
            console.log(currElem);
                return (

        <>
                <div className = "container" key = {currElem.id}>
                    <span className="idno"> {currElem.id} </span><br />
                     <div><img src = "https://www.bing.com/images/search?view=detailV2&ccid=clKpIAce&id=2A8E22000D85D36EC850F7B4BA9D26AF482E796E&thid=OIP.clKpIAceP2J1KolPoT5LFgHaDt&mediaurl=https%3a%2f%2fi0.wp.com%2fminiextensions.com%2fwp-content%2fuploads%2fsites%2f5%2f2020%2f06%2fimg2pdf.001.png&exph=1024&expw=2048&q=img+to+pdf&simid=607999861271389470&FORM=IRPRST&ck=7CCAAC21FC647FF399EDE26F000ED3D6&selectedIndex=0&ajaxhist=0&ajaxserp=0"  className="imgs" height={100}  width={100}/></div>
                    <div>
                   <h1>{currElem.model}</h1>
                   <hr style={{color:"#f1f1f1"}}></hr>
                   <p className="featurespara">features :</p>
                   <div className="featurs">
                       <p> ram :- {currElem.spec.ram}, </p>
                       <p> rom :- {currElem.spec.rom},</p>
                       <p> front_camera :- {currElem.spec.front_camera}, </p>
                       <p> rear_camera :- {currElem.spec.rear_camera} </p>
                        <button className="prizebtn" onClick = {()=>prize(currElem)}>See Price </button>
                   </div>
               </div>
            </div> 
            
        </>
                )
        })
    }
    </div>
    </>

        )}

export default Main;
